import { BrowserRouter, Switch, Route } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.css';
import './App.css';
import Home from "./page/Home" 


function App() {
  return (
      <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Home} />

      </Switch>
    </BrowserRouter>

  );
}

export default App;
